import { StyleSheet, Text } from 'react-native';
import * as Animatable from 'react-native-animatable';
import { useFonts } from 'expo-font';
import '../../constants';

export const BasicsLabel = ({ labelText, animation, delay, left }) => {
  const [loaded] = useFonts({
    ObjektivMedium: require('./../../../assets/fonts/ObjektivMk2-Medium.ttf'),
  });

  if (!loaded) {
    return null;
  }
  return (
    <>
      <Animatable.View
        animation={animation}
        delay={delay}
        left={left}
        style={styles.labelStyle}
      >
        <Text style={styles.labelText}>{labelText}</Text>
      </Animatable.View>
    </>
  );
};

const styles = StyleSheet.create({
  labelStyle: {
    position: 'absolute',
    //backgroundColor: 'red',
  },
  labelText: {
    fontFamily: 'ObjektivMedium',
    fontSize: Fonts.FONT_SIZE_DESCRIPTION,
    color: Colors.NAVY,
    //backgroundColor: 'red',
  },
});
